import React from "react";
import Table, {
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "material-ui/Table";
import Paper from "material-ui/Paper";
import { getFormValues } from "redux-form";
import { connect } from "react-redux";

const ReceiptTable = ({ values = { members: [] } }) => (
  <Paper>
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>Receipt Name</TableCell>
          <TableCell>Receipt Source</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {values.members.map((n) => {
          return (
            <TableRow key={`${n.name}-${n.source}`}>
              <TableCell>{n.name}</TableCell>
              <TableCell>{n.source}</TableCell>
            </TableRow>
          );
        })}
      </TableBody>
    </Table>
  </Paper>
);

export default connect((state) => ({
  values: getFormValues("ReceiptForm")(state),
}))(ReceiptTable);
